import '../styles/projects.css';

export default function projectcard ({carddata}) {
    const {bgc,title,image,isCompleted} = carddata;
    const imgurl = require(`../assests/projects/${image}`);
    console.log(isCompleted);
    return (
        <div className='project-card'>
            <div className={isCompleted ? "modalcard" : "blurcard"}>
            {/* {isCompleted === false && (
            <div className="project-text">
              <h4>Coming Soon</h4>
            </div>
          )} */}
            <img src={imgurl} alt={image}></img>
            <span className={bgc}>{title}</span>
        </div>
        </div>
    );
};
